import React, { Component } from "react";
import { connect } from "react-redux";
import {
  MDBCard,
  MDBCardBody,
  MDBRow,
  MDBCol,
  MDBView,
  MDBBtn,
} from "mdbreact";

export class saloncontainer extends Component {
  render() {
    return (
      <section>
        <MDBRow className="mt-0 bg ">
          <MDBCol size="6" className="mt-5 float-center">
            <div className="mt-5 ml-5">
              <input placeholder="Nom de salon" />
              <input placeholder="Nom de salon" />
              <MDBBtn color="warning">Rechecher</MDBBtn>
            </div>
          </MDBCol>
          <MDBCol size="6" className=" mt-2 ">
            <img
              className="img-fluid"
              src="https://image.freepik.com/vecteurs-libre/salon-coiffure-isometrique_146998-3732.jpg"
              alt=""
            />
          </MDBCol>
        </MDBRow>
      </section>
    );
  }
}

const mapStateToProps = (state) => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(saloncontainer);
